import{_ as e,o as t,c as r,O as o}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 33.2-299.7 Exclusions from the Virginia Freedom of Information Act; proprietary records and trade secrets.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-299.7.md","filePath":"vacode/33.2-299.7.md"}'),i={name:"vacode/33.2-299.7.md"},a=o('<h1 id="§-33-2-299-7-exclusions-from-the-virginia-freedom-of-information-act-proprietary-records-and-trade-secrets" tabindex="-1">§ 33.2-299.7 Exclusions from the Virginia Freedom of Information Act; proprietary records and trade secrets. <a class="header-anchor" href="#§-33-2-299-7-exclusions-from-the-virginia-freedom-of-information-act-proprietary-records-and-trade-secrets" aria-label="Permalink to &quot;§ 33.2-299.7 Exclusions from the Virginia Freedom of Information Act; proprietary records and trade secrets.&quot;">​</a></h1><p>A. Notwithstanding the provisions of the Virginia Freedom of Information Act (§ <a href="/vacode/2.2-3700/">2.2-3700</a> et seq.), the Authority shall keep confidential trade secrets or confidential proprietary information, not publicly available, provided by a private person or entity pursuant to a promise of confidentiality where if such information were made public, the financial interest of the private person or entity could be adversely affected. In order for trade secrets or proprietary information to be excluded from the provisions of the Virginia Freedom of Information Act, the private person or entity shall (i) invoke such exclusion upon submission of the data or other materials for which protection from disclosure is sought, (ii) identify the data or other materials for which protection is sought, and (iii) state the reason why protection is necessary.</p><p>B. Notwithstanding the provisions of the Virginia Freedom of Information Act, the Authority shall keep confidential information submitted by a private person, entity, or other party in negotiations with the Authority, where if such information was made public prior to the execution of a business arrangement, the financial interests of bargaining positions of the public or private entity would be adversely affected.</p><p>2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1230" target="_blank" rel="noreferrer">1230</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1275" target="_blank" rel="noreferrer">1275</a>.</p>',4),n=[a];function s(c,f,d,h,p,l){return t(),r("div",null,n)}const _=e(i,[["render",s]]);export{u as __pageData,_ as default};
